class RST(loader.Module):
    """Created by https://t.me/ArgostRST"""

    strings = {"name": "RST",
               "welcome": (
                   "üñê <i>–ü—Ä–∏–≤–µ—Ç—Å—Ç–≤—É—é, —Ç—ã –∑–∞–ø—É—Å—Ç–∏–ª —É—Å—Ç–∞–Ω–æ–≤–∫—É –º–æ–¥—É–ª—è <b>‚ÄûRST‚Äú</b></i>"
                   "\n\nüîó <i>–í—Å—Ç—É–ø–∞–π –≤ <a href='https://t.me/ArgostRST'>–Ω–∞—à–∏ —Ä—è–¥—ã</a>, —á—Ç–æ–±—ã –ø–æ–¥–¥–µ—Ä–∂–∞—Ç—å —Ä–∞–∑—Ä–∞–±–æ—Ç—á–∏–∫–∞</i>"
                   "\n\nü©∏ <i>–ú–æ–¥—É–ª—å —Å–æ–∑–¥–∞–Ω by <code>@evilovery</code></i>"
               ),
    }

    async def on_dlmod(self, client, db):
        await self.inline.bot.send_photo(
            client._tg_id,
            "https://envs.sh/1vi.jpg",
            caption=self.strings("welcome"),
        )

    async def client_ready(self, client, db) -> None:
        self.db = db
        self.client = client
        logging.info("–ú–æ–¥—É–ª—å RST –≥–æ—Ç–æ–≤ –≤—ã—á–∏—â–∞—Ç—å –º—É—Å–æ—Ä")

    async def rswcmd(self, message):
        """launch the calendar. replay the photo + delay + ID or user + header"""
        args = utils.get_args_raw(message)
        reply = await message.get_reply_message()
        file = reply if reply and reply.file else None
        if not args: return await utils.answer(message, '<b>Where are your arguments?</b>')
        args = args.split(' ', maxsplit=2)
        try:
            time = float(args[0])
        except:
            return await utils.answer(message, '<b>enter the time of the circuses</b>')
        if args[1].isdigit():
            args[1] = int(args[1])
        try:
            args[2] = args[2]
        except:
            args.append('')
        await utils.answer(message, '<b>.</b>')
        original_time = time
        for i in range(100):
            await self.client.send_message(args[1], args[2] + " " + choice(shablon), schedule=timedelta(minutes=time), file=file)
            time += original_time

        await message.delete()

    async def rkwcmd(self, message):
        '''the ID of the chat, the person'''
        reply = await message.get_reply_message()
        me = await message.client.get_me()
        if not reply:
            i = str(message.chat_id)
        else:
            i = str(reply.sender_id)
        if i.startswith('-100'):
            i = i[4:]

        await message.client.send_message(me.id, f"<code>{i}</code>")
        await message.delete()
